import React from 'react';

const Projects = () => {
  return (
    <div className="section">
      <h2>Projects</h2>
      <div className="project">
        <h3>Portfolio Website</h3>
        <p>Made Using Js,CSS,HTML and React.js</p>
      </div>
      <div className="project">
        <h3>Simple Calculator</h3>
        <p>Made using React.js</p>
      </div>
    </div>
  );
};

export default Projects;
